import {useSelector,useDispatch} from 'react-redux';

const listData=useSelector(state=>state.iteam);
function DisplayTask(props)
{
    return(<>
        <Div>
            <table>
                <th>
                    ID
                </th>
                <th>
                    Task
                </th>
                <th>Action</th>
                    {listData.map((e)=>
                    {
                        return(<tr>
                            <td>{e.id}</td>
                            <td>{e.value}</td>
                            <td><button>Delete</button></td>
                        </tr>)
                    }
                    )}
            </table>
        </Div>
    </>)
}
export default DisplayTask;
